      </div>      
      <button type=\"submit\" name=\"find\" value=\"find\" class=\"btn btn-default\">Filtrar</button>
    </form>
    <table id=\"chamados\" class=\"display table table-striped table-hover\" cellspacing=\"0\" width=\"100%\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Título</th>
                <th>Nome</th>
                <th>Email</th>
                <th>Id Pedido</th>
            </tr>
        </thead>
        <tbody>
